import React from 'react';
import {Slider, Label} from './SliderStyled.js';

const SliderComponent = ({type}) => {

    if(type === "peso") 
        return (  
            <>
            <Label>Peso</Label>
                <Slider type = "range" min="0" max="250"/> 
                <output id="rangevalue">50</output>
            </> 
            
        );
    
        
}

export default SliderComponent;
